import Nav from "../nav/Nav";
import Substrate from "../substrate/Substrate";
import './main.css'
// import '../../utils/js/printTxt'


const mainTitleInner = 'Привет! Я Александр Шмик'

export default function Main() {
  function printText(){

    let letterTimeout = 20;
    let el = document.getElementById( 'main__title' )
    let text = el.innerHTML
    let i = 1

    const print__fn = () => {

        if( i <= text.length ){
          el.innerHTML = text.slice( 0, i );
          setTimeout( print__fn, letterTimeout );
        }

        i++;
      }
    print__fn()
  };
  return (
    <>
      <section className="main">
        <Nav />
        <div className="container">
          <Substrate>
            <h1 className="main__title">
              {mainTitleInner}
            </h1>
          </Substrate>
        </div>
      </section>
    </>
  );
}
